// Store provides storage for announcing peers.
type Store interface {
// Close cleans up any Store resources.
Close()
// GetPeers returns at most n random peers announcing for h.
GetPeers(h core.InfoHash, n int) ([]*core.PeerInfo, error)
// UpdatePeer updates peer fields.
UpdatePeer(h core.InfoHash, peer *core.PeerInfo) error
}

// ClusterClient defines a top-level origin cluster client which handles blob
// location resolution and retries.
type ClusterClient interface {
UploadBlob(namespace string, d core.Digest, blob io.Reader) error
DownloadBlob(namespace string, d core.Digest, dst io.Writer) error
GetMetaInfo(namespace string, d core.Digest) (*core.MetaInfo, error)
Stat(namespace string, d core.Digest) (*core.BlobInfo, error)
OverwriteMetaInfo(d core.Digest, pieceLength int64) error
Owners(d core.Digest) ([]core.PeerContext, error)
ReplicateToRemote(namespace string, d core.Digest, remoteDNS string) error
}

// Store is a local cache in front of the origin cluster
// which is resilient to origin unavailability.
type Store interface {
// GetOrigins returns all available origins seeding d.
// Returns error if all origins are unavailable.
GetOrigins(d core.Digest) ([]*core.PeerInfo, error)
}
